import logo from './img/rick-morty.png';
import './App.css';

function App() {

  const api = async() =>{
    const urlApi = await fetch('https://rickandmortyapi.com/api/character')
    const characterApi = await urlApi.json();
    console.log(characterApi);
 }

  return (
    <div className="App">
      <header className="App-header">
      <h1 className='title'>Rick and Morty</h1>
        <img src={logo} alt='Rick and Morty' className='img-home'></img>
        <button onClick={api} className='btn-search'>Buscar Personaje</button>
      </header>
    </div>
  );
}

export default App;
